let initialState = ["pathname", "email"];

const DataReducer = (state = initialState, action) => {
  switch (action.type) {
    case "pathname":
      initialState[0] = action.payload.path;
      return initialState;
    case "email":
    initialState[1] = action.payload.path;
      return state;
    default:
      return 0;
  }
};

export default DataReducer;
